import React, { Component } from 'react';
import ListGroupItem from '@bit/react-bootstrap.react-bootstrap.list-group-item';
import ListGroup from '@bit/react-bootstrap.react-bootstrap.list-group';
import Card from '@bit/react-bootstrap.react-bootstrap.card';
import ReactBootstrapStyle from '@bit/react-bootstrap.react-bootstrap.internal.style-links';

class Example extends Component {
	render() {
		return (
			<div style={{ marginTop: 20, marginBottom: 20, width: 400 }}>
				<Card style={{ width: '18rem' }}>
					<Card.Img variant="top" src="https://picsum.photos/100/100" />
					<Card.Body>
						<Card.Title>Card Title</Card.Title>
						<Card.Text>
							Some quick example text to build on the card title and make up the bulk of
							the card's content.
    				</Card.Text>
					</Card.Body>
					<ListGroup className="list-group-flush">
						<ListGroupItem>Cras justo odio</ListGroupItem>
						<ListGroupItem>Dapibus ac facilisis in</ListGroupItem>
						<ListGroupItem>Vestibulum at eros</ListGroupItem>
					</ListGroup>
					<Card.Body>
						<Card.Link href="#">Card Link</Card.Link>
						<Card.Link href="#">Another Link</Card.Link>
					</Card.Body>
				</Card>
			</div>
		)
	}
}

export default () => (<div><ReactBootstrapStyle /><Example /></div>)
